import {useState, useEffect} from 'react';


function Form(){

    useEffect(() => {
        console.log("Use Effect Processed!");
    });

    const [name,setName]=useState("");
    const [email,setEmail]=useState("");
    const [mobile,setMobile]=useState("");
    const [password,setPassword]=useState("");

    return(

        <div>
            <br></br>

            <center>
                Name <br/>
                <input type = "text" placeholder="Enter Name" value={name} onChange={(e)=> setName(e.target.value)}></input><br/>
                Email <br/>
                <input type = "text" placeholder="Enter Email" value={email} onChange={(e)=> setEmail(e.target.value)}></input><br/>
                Mobile Number <br/>
                <input type = "text" placeholder="Enter Number" value={mobile} onChange={(e)=> setMobile(e.target.value)}></input><br/>
                Password <br/>
                <input type = "password" placeholder="Enter Password" value={password} onChange={(e)=> setPassword(e.target.value)}></input>
                
                
            </center>
            

        </div>
    )
}

export default Form
